static TreeNode* removeAt(TreeNode*& x, TreeNode*& hot) {
	TreeNode* w = x;
	TreeNode* u;
	TreeNode* succ = NULL;
	if ((*x).left == NULL)
		succ = x = x->right;
	else if ((*x).right == NULL)
		succ = x = x->left;
	else {
		{
			u = x;
			while (w->left != nullptr)
			{
				u = w;
				w = w->left;
			}
		}
		std::swap(x->val, w->val);
		((u == x) ? u->right : u->left) = succ = w->right;
	}
	hot = w; //if (succ) succ->parent = hot; 
	return succ;
}
